import React from 'react';
import { Link } from 'react-router-dom';
import styles from './about.module.css'; // Asegúrate de cambiar la extensión a .module.css

import imagen from '../IMG/fondo_control.jpg';

function About() {
  return (
    <>
           <img className={styles.image} src={imagen} alt="foto" />
      <Link to="/home">
        <button className={styles.button}>Volver al Inicio</button>
      </Link>
      <div className={styles.container}>
        <div>
          <h1 className={styles.title}>PI HENRY VIDEOGAMES 2024</h1>
          <h1 className={styles.title}>Mirko Miler</h1>
        </div>
 
      </div>
    </>
  );
}

export default About;
